exports.start = function () {
  window.onload = function () {
    var config = require('./config')
    var greet = require('./greet')(config.greeting)
    var o = require('jquery')
    var rel = require('relative')
    alert(rel)
    var tip = require('tip')
    tip('a[title]', { delay: 300 })
    o('a').on('click', greet)
  }
}
